/**
 * This type declaration cab be used as a generic interface to allow indexing into properties
 *
 * Example:
 * ```
 *  interface IBar {
 *      hello: string;
 *  }
 *
 *  let temp:IBar;
 *  temp.hello = 'world!'; // no error
 *  temp.otherProp = 'oops!'; // error, 'otherProp' does not exist on 'temp'
 * ```
 *
 * Now, we using the below definition, let us instead define temp as follows
 *
 * ```
 *  let temp:IGeneric<IBar>;
 *  temp.hello = 'world!'; // no error, we get intellisense too!
 *  temp.otherProps = 'no error'; // no error now due to fallback of IGeneric definition
 * ```
 */
export declare type IGeneric<T extends unknown> = T & {
    [x: string]: any;
};
export declare type IAny = unknown;
